def evaluate(weights, target_people, dataset, mode='maximize'):
    weights_dict = {
        'collab_exists_weight': weights[0],
        'collab_count_weight': weights[1],
        'mention_exists_weight': weights[2],
        'mention_count_weight': weights[3],
        'institution_match_weight': weights[4],
        'github_match_weight': weights[5],
        'publication_electosense_weight': weights[6]
    }

    if mode == 'maximize':
        filtered_dataset = [data for data in dataset if data['Name'] in target_people]
    elif mode == 'minimize':
        filtered_dataset = [data for data in dataset if data['Name'] not in target_people]
    else:
        raise ValueError("Invalid mode. Must be 'maximize' or 'minimize'.")

    calculate_match_score(filtered_dataset, **weights_dict)

    match_scores = [data['match_score'] for data in filtered_dataset]

    if match_scores:
        average_match_score = sum(match_scores) / len(match_scores)
    else:
        average_match_score = 0

    return average_match_score,




# create fitness and individual classes
creator.create("FitnessMax", base.Fitness, weights=(1.0,))
creator.create("Individual", list, fitness=creator.FitnessMax)

toolbox = base.Toolbox()

# attribute generator
toolbox.register("attr_float", random.random)

# structure initializers
toolbox.register("individual", tools.initRepeat, creator.Individual, toolbox.attr_float, n=7)
toolbox.register("population", tools.initRepeat, list, toolbox.individual)

# register the goal / fitness function
toolbox.register("evaluate", evaluate, target_people=names_list, dataset=dataset, mode='minimize')
# ensure weights are between 0 and 1 during initialization
toolbox.register("attr_float", random.random)

# ensure weights are between 0 and 1 after mutation
def mutate(individual):
    index = random.randint(0, len(individual) - 1)
    individual[index] = random.random()

toolbox.register("mutate", mutate)


# register the crossover operator
toolbox.register("mate", tools.cxUniform, indpb=0.1)

# register a mutation operator with a probability to
# flip each attribute/gene of 0.05
toolbox.register("mutate", tools.mutGaussian, mu=0, sigma=0.2, indpb=0.1)

# operator for selecting individuals for breeding
toolbox.register("select", tools.selTournament, tournsize=3)


def main():
    random.seed(64)

    # create an initial population of 300 individuals
    pop = toolbox.population(n=300)

    # CXPB is the probability with which two individuals are crossed
    CXPB = 0.5

    # MUTPB is the probability for mutating an individual
    MUTPB = 0.2

    # NGEN stands for the number of generations
    NGEN = 40

    print("Start of evolution")

    # Evaluate the entire population
    fitnesses = list(map(toolbox.evaluate, pop))
    for ind, fit in zip(pop, fitnesses):
        ind.fitness.values = fit

    print(f"  Evaluated {len(pop)} individuals")

    # Begin the evolution
    for g in range(NGEN):
        print(f"-- Generation {g} --")

        # Select the next generation individuals
        offspring = toolbox.select(pop, len(pop))
        # Clone the selected individuals
        offspring = list(map(toolbox.clone, offspring))

        # Apply crossover and mutation on the offspring
        for child1, child2 in zip(offspring[::2], offspring[1::2]):
            if random.random() < CXPB:
                toolbox.mate(child1, child2)
                del child1.fitness.values
                del child2.fitness.values

        for mutant in offspring:
            if random.random() < MUTPB:
                toolbox.mutate(mutant)
                del mutant.fitness.values

        # Evaluate the individuals with an invalid fitness
        invalid_ind = [ind for ind in offspring if not ind.fitness.valid]
        fitnesses = map(toolbox.evaluate, invalid_ind)
        for ind, fit in zip(invalid_ind, fitnesses):
            ind.fitness.values = fit

        print(f"  Evaluated {len(invalid_ind)} individuals")

        # The population is entirely replaced by the offspring
        pop[:] = offspring

        # Gather all the fitnesses in one list and print the stats
        fits = [ind.fitness.values[0] for ind in pop]

        length = len(pop)
        mean = sum(fits) / length
        sum2 = sum(x * x for x in fits)
        std = abs(sum2 / length - mean ** 2) ** 0.5

        print(f"  Min {min(fits)}, Max {max(fits)}")
        print(f"  Average {mean}, Std Dev {std}")

    print("-- End of (successful) evolution --")

    best_ind = tools.selBest(pop, 1)[0]
    print(f"Best individual is {best_ind}, {best_ind.fitness.values}")


if __name__ == "__main__":
    main()
